script: |
  super -f text -I q12048.spq | sort > q12048.out

inputs:
  - name: q12048.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT + ( col2 ) BETWEEN col0 * col0 + - col0 / ( + col0 ) AND + 91 * - ( + col1 ) - 40;
  - name: tab2

outputs:
  - name: q12048.out
    data: |
      46	51	23
      64	77	40
      75	67	58
